            </h1>
            <Row className="d-flex">
                {pet.pets.filter(pets => pets.type === '–°–æ–±–∞–∫–∞').map(pet =>
                    <PetCard key={pet.id} pet={pet}/>
                )}
            </Row>
        </Container>
    );
});

export default AllDogs;
